import ProductList from "../components/ProductList";

function Shop() {
  return (
    <div style={{
      minHeight: "100vh",
      background: "linear-gradient(135deg,#ffe29f 0%,#ffa99f 50%,#fffde4 100%)",
      padding: "40px 0"
    }}>
      <div style={{ maxWidth: 1100, margin: "0 auto", padding: "0 24px" }}>
        <h1 style={{ textAlign: "center", color: "#d4380d", fontSize: 38, fontWeight: 700, marginBottom: 40, letterSpacing: 1 }}>Shop Our Sweets</h1>
        <div style={{ marginBottom: 48 }}>
          <h2 style={{ color: "#141414", fontSize: 28, fontWeight: 600, marginBottom: 18 }}>üç¶ Ice Creams</h2>
          <ProductList category="icecream" />
        </div>
        <div>
          <h2 style={{ color: "#141414", fontSize: 28, fontWeight: 600, marginBottom: 18 }}>üç´ Chocolates</h2>
          <ProductList category="chocolate" />
        </div>
      </div>
    </div>
  );
}

export default Shop;
